// import PostCard from "./postCard";
import PostPage from "./postPage";
import PostsPage from "./postsPage";

const Posts = () => {
  const params = useParams();
  const postId = params.postId;

  return <>{postId ? <PostPage /> : <PostsPage />}</>;
};

export default Posts;
